const HANDLERS_PATH="./views/templates/";class TemplateHandler{getTemplate(e){const t=`${HANDLERS_PATH}${e}.hbs`;return console.log(t),new Promise((e,l)=>{$.get(t).done(e).fail(l)})}setTemplate(e,t,l){return this.getTemplate(e).then(e=>{const n=Handlebars.compile(e)(l),a=$("<div/>");return a.html(n),$(t).html(a.html()),e}).catch(console.log)}}const templateHandler=new TemplateHandler;export{templateHandler};